from pybricks.hubs import PrimeHub
from pybricks.parameters import Axis, Button, Color, Direction, Port, Stop
from pybricks.pupdevices import ColorSensor, Motor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

from CodeStartHSV import color_sense

# Set up all devices.
Brain = PrimeHub(top_side=Axis.Z, front_side=Axis.X)
color_sensor = ColorSensor(Port.F)
Left_Motor = Motor(Port.E, Direction.COUNTERCLOCKWISE)
Right_Motor = Motor(Port.B, Direction.CLOCKWISE)
DriveTrain = DriveBase(Left_Motor, Right_Motor, 62, 93.5)
Right_Attachment = Motor(Port.D, Direction.CLOCKWISE)
Left_Attachment = Motor(Port.C, Direction.CLOCKWISE)

# Initialize variables.
Straight_Speed = 950
Straight_Acceleration = 925
Turn_Speed = 400
Turn_Acceleration = 800
Program_List = ['1', '2', '3', '4', '5', '6', '7', '8']
In_Leg = 0
Current_Program = 1

async def Color_Select():
    await wait(1)
    if await color_sensor.color() == Color.GREEN:
        await wait(1000)
        await Whale()
    elif await color_sensor.color() == Color.BLUE:
        await wait(1000)
        await whale_krill_collector()
    else:
        pass

async def unknown():
    await wait(1)
    await Start_Code()
    await DriveTrain.straight(-690)

async def Start_Code():
    global In_Leg
    await wait(1)
    Brain.display.off()
    Brain.imu.reset_heading(0)
    Brain.light.on(Color.GREEN)
    In_Leg = 1
    Brain.display.pixel(0, 0, 100)
    Brain.display.pixel(1, 1, 80)
    Brain.display.pixel(2, 2, 60)
    Brain.display.pixel(3, 3, 40)
    Brain.display.pixel(4, 4, 10)

async def coral_tree():
    await wait(1)
    await Start_Code()
    await DriveTrain.straight(-150)
    await DriveTrain.turn(50)
    await DriveTrain.straight(-306)
    await DriveTrain.turn(-50)
    await DriveTrain.straight(-300)
    await DriveTrain.turn(-88)
    DriveTrain.settings(straight_speed=250)
    await DriveTrain.straight(-200)
    DriveTrain.settings(straight_speed=Straight_Speed)
    await Left_Attachment.run_target(200, -35, Stop.COAST)

async def squid_send_sub():
    await wait(1)
    await Start_Code()
    # Drives toward M9 to obtain squid
    # then goes to M10 to push up the
    # submarine using pnuematics
    await DriveTrain.straight(390)
    # Backs up, then turns right, then left,
    # then goes forward to push the submarine up
    # for M10 using pnuematics.
    await DriveTrain.straight(-50)
    await DriveTrain.turn(-90)
    # Hits the submarine
    await DriveTrain.straight(-140)
    await DriveTrain.turn(-92)
    await DriveTrain.straight(-700)
    await DriveTrain.turn(60)
    # Parks over the cold seep
    await DriveTrain.straight(150)
    while True:
        await wait(1000)

async def Arrow_Select():
    global Current_Program, In_Leg
    await wait(1)
    if Button.RIGHT in Brain.buttons.pressed():
        Current_Program = Current_Program + 1
        await wait(350)
    elif Button.LEFT in Brain.buttons.pressed():
        Current_Program = Current_Program - 1
        await wait(350)
    elif Button.CENTER in Brain.buttons.pressed():
        if Current_Program == 1:
            await pirate_ship()
            await wait(300)
        elif Current_Program == 2:
            await Whale()
            await wait(300)
        elif Current_Program == 3:
            await squid_send_sub()
            await wait(300)
        elif Current_Program == 4:
            await coral_tree()
            await wait(300)
        elif Current_Program == 5:
            await unknown()
            await wait(200)
        elif Current_Program == 6:
            await whale_krill_collector()
            await wait(100)
        elif Current_Program == 7:
            await color_sense()
            await wait(100)
        elif Current_Program == 8:
            await Battery()
            await wait(100)
        else:
            pass
    else:
        await wait(10)
    In_Leg = 0

async def pirate_ship():
    global Straight_Speed, Straight_Acceleration
    await wait(1)
    await Start_Code()
    await DriveTrain.straight(-410)
    await DriveTrain.turn(30, Stop.COAST)
    await DriveTrain.straight(-160)
    await DriveTrain.turn(65, Stop.COAST)
    Straight_Speed = 2300
    Straight_Acceleration = 2500
    await DriveTrain.straight(-300)
    Straight_Speed = 950
    Straight_Acceleration = 900
    await DriveTrain.straight(160)
    await DriveTrain.turn(-65)
    await DriveTrain.straight(600, Stop.COAST)
    while True:
        await wait(1000)

async def whale_krill_collector():
    await wait(1)
    await Start_Code()
    DriveTrain.settings(straight_speed=Straight_Speed - 450)
    DriveTrain.settings(straight_acceleration=Straight_Acceleration - (375 - 75))
    DriveTrain.settings(turn_rate=Turn_Speed - 100)
    await DriveTrain.straight(-670)
    await wait(80)
    await DriveTrain.turn(25)
    await DriveTrain.turn(25)
    await DriveTrain.straight(-110)
    await Right_Attachment.run_angle(500, 100)
    await DriveTrain.straight(100)
    await DriveTrain.turn(-125)
    await DriveTrain.straight(-250)
    await DriveTrain.turn(20)
    await DriveTrain.straight(-100)
    await DriveTrain.turn(-10)
    await Left_Attachment.run_angle(450, 300)
    await DriveTrain.turn(-50)
    await Left_Attachment.run_angle(445, -75)
    await DriveTrain.straight(-140)
    await DriveTrain.turn(25)
    await DriveTrain.straight(-350)
    await DriveTrain.turn(10)
    await DriveTrain.straight(-200)
    await Right_Attachment.run_angle(500, -100)
    await DriveTrain.curve(-275, 90, Stop.COAST)
    await DriveTrain.straight(-800)

async def Start_Task():
    global In_Leg
    await wait(1)
    In_Leg = 1
    Brain.display.off()
    Brain.display.pixel(1, 1, 30)
    Brain.display.pixel(2, 2, 50)
    Brain.display.pixel(3, 3, 70)
    Brain.imu.reset_heading(0)
    DriveTrain.settings(straight_speed=Straight_Speed)
    DriveTrain.settings(straight_acceleration=Straight_Acceleration)
    DriveTrain.settings(turn_rate=Turn_Speed)
    DriveTrain.settings(turn_acceleration=Turn_Acceleration)
    DriveTrain.straight(0)

async def Battery():
    await wait(1)
    while True:
        await wait(1)
        print(Brain.battery.voltage())
        await wait(1500)

async def Whale():
    await wait(1)
    await Start_Code()
    await DriveTrain.straight(-710, Stop.COAST)
    await DriveTrain.turn(45)
    DriveTrain.settings(straight_speed=250)
    await wait(150)
    await DriveTrain.straight(-190)
    DriveTrain.settings(straight_speed=Straight_Speed)
    await wait(900)
    await DriveTrain.straight(260)
    await DriveTrain.turn(85)
    await Right_Attachment.run_angle(500, 85)
    await DriveTrain.straight(-165)
    await Right_Attachment.run_angle(500, -90)
    await wait(750)
    await DriveTrain.straight(-140, Stop.COAST)

async def main1():
    Brain.imu.reset_heading(0)
    DriveTrain.settings(straight_speed=Straight_Speed)
    DriveTrain.settings(straight_acceleration=Straight_Acceleration)
    DriveTrain.settings(turn_rate=Turn_Speed)
    DriveTrain.settings(turn_acceleration=Turn_Acceleration)
    DriveTrain.straight(0)
    DriveTrain.use_gyro(True)
    while True:
        await wait(1)
        Brain.display.number(Current_Program)
        Brain.light.on(Color.MAGENTA)
        await Color_Select()
        await Arrow_Select()

async def main2():
    while True:
        await wait(1)
        if In_Leg == 1:
            await wait(200)
            Brain.system.set_stop_button(Button.CENTER)
        else:
            Brain.system.set_stop_button(None)

async def main3():
    pass


async def main():
    await multitask(main1(), main2(), main3())

run_task(main())